        <main>
            <div>
                <Navigation />
            </div>
            <div >
                <img id="banner" src="C:\Users\zflot\development\milestone-two-project\diy-tutorial-app\client\src\assets\banner.jpg"
                    alt="home banner">
                </img>
            </div>
            <h1>Home</h1>
        </main>
    )
}

export default Home
